import styles from './main.module.scss'

const NewMain = () => {
  return (
    <div className={styles.main}>
      <div className={styles.banner}>
        내 책을 소개합니다. 배너
        <button>자세히 보기</button>
      </div>
      베스트셀러
    </div>
  )
}

export default NewMain
